import React, { useState, useRef } from 'react';
import axios from 'axios';
import './app.css';
import TiltedCard from './TiltedCard';

// Import the image for the first team member
import nakulImage from './assets/.jpg'; // Adjust path if necessary

function App() {
  const [file, setFile] = useState(null);
  const [response, setResponse] = useState('');
  const [loading, setLoading] = useState(false);

  // Use a ref to trigger the file input programmatically
  const fileInputRef = useRef(null);

  // Handle file selection
  const onFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  // Trigger the hidden file input when user clicks the 'Select PDF files' button
  const handleSelectFile = () => {
    if (fileInputRef.current) {
      fileInputRef.current.click();
    }
  };

  // Handle file upload
  const onFileUpload = async () => {
    if (!file) {
      alert('Please select a file first!');
      return;
    }
    setLoading(true);

    const formData = new FormData();
    formData.append('file', file);

    try {
      // Adjust the URL if your backend runs on a different port or domain
      const res = await axios.post('http://localhost:5000/upload', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      // We expect "clean_text" in the JSON response
      setResponse(res.data.clean_text);
    } catch (error) {
      console.error('Error uploading file:', error);
      setResponse('Error uploading file');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      {/* Landing Section */}
      <div className="landing-section">
        <h1 className="main-heading">Tender Summarizer</h1>
        <p className="subheading">
          Summarize your tender documents quickly and easily in one place.
        </p>

        {/* Button to select PDF */}
        <button className="primary-button" onClick={handleSelectFile}>
          <i className="fas fa-file-upload"></i> Select PDF files
        </button>

        {/* Hidden file input */}
        <input
          type="file"
          ref={fileInputRef}
          style={{ display: 'none' }}
          onChange={onFileChange}
          accept="application/pdf"
        />

        {/* Display selected file name */}
        {file && <p className="selected-file">Selected file: {file.name}</p>}

        {/* Button to actually upload the file */}
        <button className="upload-button" onClick={onFileUpload} disabled={loading}>
          {loading ? 'Uploading...' : 'Upload'}
        </button>
      </div>

      {/* Response Section */}
      {response && (
        <div className="response-section">
          <h2>Summary Response</h2>
          <div className="response-card">
            {loading ? <div className="loader"></div> : <p>{response}</p>}
          </div>
        </div>
      )}

      {/* About Section */}
      <div className="about-section">
        <h2>About Us</h2>
        <p>
          This project is done by Visionary Club Tech team. We aim to streamline
          the tender summarization process for faster, more efficient workflows.
        </p>
        
        <div className="team-cards">
          {/* Team Member 1 (using the imported nakulImage) */}
          <TiltedCard
            imageSrc={nakulImage}
            altText="Nakul Chandak"
            captionText="Nakul"
            containerHeight="300px"
            containerWidth="200px"
            imageHeight="300px"
            imageWidth="200px"
            rotateAmplitude={12}
            scaleOnHover={1.2}
            showMobileWarning={false}
            showTooltip={true}
            displayOverlayContent={true}
            overlayContent={
              <a href="https://www.linkedin.com/in/member1" target="_blank" rel="noopener noreferrer">
                <i className="fab fa-linkedin"></i>
              </a>
            }
          />

          {/* Team Member 2 */}
          <TiltedCard
            imageSrc="path/to/photo2.jpg"
            altText="Team Member 2"
            captionText="Member 2"
            containerHeight="300px"
            containerWidth="200px"
            imageHeight="300px"
            imageWidth="200px"
            rotateAmplitude={12}
            scaleOnHover={1.2}
            showMobileWarning={false}
            showTooltip={true}
            displayOverlayContent={true}
            overlayContent={
              <a href="https://www.linkedin.com/in/member2" target="_blank" rel="noopener noreferrer">
                <i className="fab fa-linkedin"></i>
              </a>
            }
          />

          {/* Team Member 3 */}
          <TiltedCard
            imageSrc="path/to/photo3.jpg"
            altText="Team Member 3"
            captionText="Member 3"
            containerHeight="300px"
            containerWidth="200px"
            imageHeight="300px"
            imageWidth="200px"
            rotateAmplitude={12}
            scaleOnHover={1.2}
            showMobileWarning={false}
            showTooltip={true}
            displayOverlayContent={true}
            overlayContent={
              <a href="https://www.linkedin.com/in/member3" target="_blank" rel="noopener noreferrer">
                <i className="fab fa-linkedin"></i>
              </a>
            }
          />

          {/* Team Member 4 */}
          <TiltedCard
            imageSrc="path/to/photo4.jpg"
            altText="Team Member 4"
            captionText="Member 4"
            containerHeight="300px"
            containerWidth="200px"
            imageHeight="300px"
            imageWidth="200px"
            rotateAmplitude={12}
            scaleOnHover={1.2}
            showMobileWarning={false}
            showTooltip={true}
            displayOverlayContent={true}
            overlayContent={
              <a href="https://www.linkedin.com/in/member4" target="_blank" rel="noopener noreferrer">
                <i className="fab fa-linkedin"></i>
              </a>
            }
          />
        </div>
      </div>
    </div>
  );
}

export default App;
